INSERT INTO `Issues` VALUES (1,'Spring',1988,'Page 11 has a Bell of Pennsylvania add, page 29 shows an RCI bill, page 39 has a State of Florida Public Service Commission letter, that are not in the index.','FrontCoverImages/Spring1988.gif','BackCoverImages/Spring1988.gif',1,5,NULL,48),(2,'Summer',1988,'Page 43 has a phone photo by John Drake that is not in the index.','FrontCoverImages/Summer1988.gif','BackCoverImages/Summer1988.gif',2,5,NULL,48),(3,'Autumn',1988,'Page 19 has an advertisement from New York Telephone, page 22 and 23 have a memo about unauthorized DOCMASTER access reprinted from w.o.r.m. 1.5, page 33 has a funny fax, page 39 has artwork by J.R. Dobbs, page 40 has an employee memo from Illinois Bell, that are not in the index.','FrontCoverImages/Autumn1988.gif','BackCoverImages/Autumn1988.gif',3,5,NULL,48),(4,'Winter',1988,'Page 2 has a National Telephone Company, Limited bulletin, page 18 has a copy of an Operator Assistance Network bill, page 33 has an AT&T direct dial service notice, that are not in the index.','FrontCoverImages/Winter1988.gif','BackCoverImages/Winter1988.gif',4,5,'',48),(5,'Spring',1989,'Page 1 has an Allied Communications Publication, page 7 has a Department of Defense notice about telephone use, that are not in the index.','FrontCoverImages/Spring1989.gif','BackCoverImages/Spring1989.gif',1,6,NULL,48),(6,'Summer',1989,'Page 1 has a security bulletin from Grumman, page 9 has a \"PHONE POLICE\" flyer, page 17 has a Red Box flyer, that are not in the index.','FrontCoverImages/Summer1989.gif','BackCoverImages/Summer1989.gif',2,6,NULL,48),(7,'Autumn',1989,'Page 31 shows a fax received by 2600, page 35 has a British Telecom Ad, page 44 prints a Defense Department phone book\'s telephone tips, that are not in the index.','FrontCoverImages/Autumn1989.gif','BackCoverImages/Autumn1989.gif',3,6,NULL,48),(8,'Winter',1989,'Page 39 and 40 have a comic and humorous picture that are not in the index.','FrontCoverImages/Winter1989.gif','BackCoverImages/Winter1989.gif',4,6,NULL,48),(9,'Spring',1990,'Page 11 has an Operation Sundevil map and a brain wave spoof, page 22 has a funny offer and an interesting fax, that are not in the index.','FrontCoverImages/Spring1990.gif','BackCoverImages/Spring1990.gif',1,7,'',48),(10,'Summer',1990,'','FrontCoverImages/Summer1990.gif','BackCoverImages/Summer1990.gif',2,7,'',48),(11,'Autumn',1990,'Page 35 has a \"check\" and an AT&T document that are not listed in the index.','FrontCoverImages/Autumn1990.gif','BackCoverImages/Autumn1990.gif',3,7,NULL,48),(12,'Winter',1990,'Page 4 and 45 are blank and not \"hacking scandal\" as the index indicates, page 31 has a funny advertisement sent in by a reader, page 40 has a notice from NYNEX, that are not in the index.','FrontCoverImages/Winter1990.gif','BackCoverImages/Winter1990.gif',4,7,'',48),(13,'Spring',1991,'Page 10 has a letter from Pepsi, page 18 has a TymCard/IQ, INC ad and comment, page 30 has a blank US District Court document, page 35 has a letter from a Texas Prison, that are not in the index.','FrontCoverImages/Spring1991.gif','BackCoverImages/Spring1991.gif',1,8,'',48),(14,'Summer',1991,'Page 6 has the breakdown of costs for the 911 document fiasco, page 13 shows pictures from a neo-Nazi computer game, page 34 has a \"proprietary\" phone company document page, that are not in the index.','FrontCoverImages/Summer1991.gif','BackCoverImages/Summer1991.gif',2,8,NULL,48),(15,'Autumn',1991,'Page 21 has a letter from TRW, page 42 has \'More Exciting Prison News\' that are not in the index.','FrontCoverImages/Autumn1991.gif','BackCoverImages/Autumn1991.gif',3,8,'',48),(16,'Winter',1991,'Page 4 has a picture of a building with 2600 address, page 20 has an example of a scam, page 21 has USPS Hacking Corrections and page 38 has a beer logo and what L.O.D. really stands for, that are not in the index.','FrontCoverImages/Winter1991.gif','BackCoverImages/Winter1991.gif',4,8,'\"They are satisfying their own appetite to know something that is not theirs to know.\" - Asst. District Attorney Don Ingraham',48),(17,'Spring',1992,'Page 7 displays some LAPD computer messages, page 20 display a scam to look out for, and are not in the index.','FrontCoverImages/Spring1992.gif','BackCoverImages/Spring1992.gif',1,9,'\"They are satisfying their own appetite to know something that is not theirs to know.\" - Asst. District Attorney Don Ingraham',48),(18,'Summer',1992,'Page 36 and 37 has a Bellcore letter and 2600 response that is not in the index.','FrontCoverImages/Summer1992.gif','BackCoverImages/Summer1992.gif',2,9,'\"The back door program included a feature that was designed to modify a computer in which the program was inserted so that the computer would be destroyed if someone accessed it using a certain password.\" - United States Department of Justice, July 1992',48),(19,'Autumn',1992,'Page 7 has the top ten scams of 1991, page 8 has an AT&T letter sent to \"Minor Threat\", page 11 has an AT&T fraud claim form, page 12 has a letter from Phone Management Enterprises, page 18 has NYNEX Telephone Service Allowance info, page 23 has info from China, page 39 has info on Meridian Mail hotel voice mail system, that are not in the index.','FrontCoverImages/Autumn1992.gif','BackCoverImages/Autumn1992.gif',3,9,'\"The back door program included a feature that was designed to modify a computer in which the program was inserted so that the computer would be destroyed if someone accessed it using a certain password.\" - United States Department of Justice, July 1992',48),(20,'Winter',1992,'Page 15 has a PTI Model 60 Prison Phone ad, page 16 has a Concern for Calcutta ad, page 23 has a 800 Numbers ad, page 39 has a letter from NYNEX, page 40 has a 900 number ad, not in the index.','FrontCoverImages/Winter1992.gif','BackCoverImages/Winter1992.gif',4,9,'\"The back door program included a feature that was designed to modify a computer in which the program was inserted so that the computer would be destroyed if someone accessed it using a certain password.\" - United States Department of Justice, July 1992',48),(21,'Spring',1993,NULL,'FrontCoverImages/Spring1993.gif','BackCoverImages/Spring1993.gif',1,10,'\"The Secret Service didn\'t do a good job in this case. We know no investigation took place. Nobody gave concern as to whether statutes were involved. We know there was damage.\" - Judge Sparks, Steve Jackson vs. Secret Service, January 28, 1993',48),(22,'Summer',1993,NULL,'FrontCoverImages/Summer1993.gif','BackCoverImages/Summer1993.gif',2,10,'\"The Secret Service didn\'t do a good job in this case. We know no investigation took place. Nobody gave concern as to whether statutes were involved. We know there was damage.\" - Judge Sparks, Steve Jackson vs. Secret Service, January 28, 1993',48),(23,'Autumn',1993,'Page 37 contains a correction to a schematic from the last issue that is not in the index.','FrontCoverImages/Autumn1993.gif','BackCoverImages/Autumn1993.gif',3,10,'\"At this time the Secret Service has no reason to believe that the suspect(s) in its investigation, or the plaintiff in this case, are aware of the nature of the Secret Service\'s investigation, who is under investigation by the Secret Service, what information is in the possession of the Secret Service, or who has provided information to the Secret Service in regard to this matter.\" - Secret Service affidavit responding to CPSR Freedom of Information Act request concerning the breakup of the November 1992 Washington DC 2600 Meeting',48),(24,'Winter',1993,'Page 13 has a letter from Ohio Bell, page 14 has a letter from a Sherrifs Department, that are not in the index.','FrontCoverImages/Winter1993.gif','BackCoverImages/Winter1993.gif',4,10,'\"At this time the Secret Service has no reason to believe that the suspect(s) in its investigation, or the plaintiff in this case, are aware of the nature of the Secret Service\'s investigation, who is under investigation by the Secret Service, what information is in the possession of the Secret Service, or who has provided information to the Secret Service in regard to this matter.\" - Secret Service affidavit responding to CPSR Freedom of Information Act request concerning the breakup of the November 1992 Washington DC 2600 Meeting',48),(25,'Spring',1994,NULL,'FrontCoverImages/Spring1994.gif','BackCoverImages/Spring1994.gif',1,11,NULL,48),(26,'Summer',1994,'Page 13 has info about the First U.S. Hacker Congress Hackers On Planet Earth (HOPE) that is not in the index.','FrontCoverImages/Summer1994.gif','BackCoverImages/Summer1994.gif',2,11,'\"Our experience has found that the best way to hurt a computer offender is to take away his toys. Computers are expensive items, and young offenders in particular may be unable to replace them. The seizure of the offender\'s computer by police also immediately and dramatically brings home the consequences of computer crime in a way that interjudicial proceedings cannot match. The knowledge that the seized computer system will be retained by law enforcement hastens the realization that the offender must change his lifestyle.\" - Kenneth Rosenblatt from \"Deterring Computer Crime\" as published in \"Prosecutor\'s Brief\", Summer 1989',48),(27,'Autumn',1994,'Page 7 contains two letters detailing corporate computer foulups, page 10 has a poster directed at phreaking, page 16 has a NYNEX memo, that are not in the index.','FrontCoverImages/Autumn1994.gif','BackCoverImages/Autumn1994.gif',3,11,'\"A pretty face can hide an evil mind. Be careful what you say - you\'ll give yourself away.\" - Johnny Rivers, \"Secret Agent Man\"',48),(28,'Winter',1994,'Page 11 contains a letter from the US Department of Justice, page 23 lists the funding for EFF and page 40 has a letter from Rop Gonggijp former editor of Hack-Tic that are not in the index.','FrontCoverImages/Winter1994.gif','BackCoverImages/Winter1994.gif',4,11,'\"He\'s an absolutely appalling influence on young men who fall for the glamorization of crime he publishes.\" - Hacker Prosecutor Gail Thackeray on Emmanuel Goldstein',48),(29,'Spring',1995,'Page 22 contains a copy of an military email and page 47 has an AT&T Megasystems memo not included in the index.','FrontCoverImages/Spring1995.gif','BackCoverImages/Spring1995.gif',1,12,'\"There are an estimated 35,000 hackers in the U.S. and their community is growing by an estimated 10 percent annually. They are not isolated individuals, slaving away in a vacuum; hackers have established formal operations within every metropolitan city in North America. Hackers communicate via compromised Internet gateways, long-distance calls stolen from corporate victims and through about 1,300 underground bulletin boards across the U.S. This infrastructure collects and disburses a constant flow of stolen calling-card information, corporate voice-mail-access data, compromised PBX DISA-port numbers, hackable modems, cloned cellular telephones and cellular-phone IDs.... The threat to U.S. businesses also has recently taken a new direction, due to hackers\' growing numbers and maturity. Security investigations have confirmed that known hackers are employed within Fortune 500 firms, which know nothing about the individuals\' prior activities. The risk to U.S. bisinesses is clear: What will happen when one of these hacker\'s employment is terminated? Will the individual destroy or damage the company\'s voice/data networks, release vital information about these networks to other hackers, or plant the seeds of future destruction in company systems? Time will tell.\" - unbridled paranoia from The Organized Hackerhood, part of McDonnell Douglas\' internal security newsletter leaked to us by an inside hacker.',60),(30,'Summer',1995,'Page 17 contains a letter from AT&T, page 26 and 27 contain documents referencing the Bernie S. case that are not in the index.','FrontCoverImages/Summer1995.gif','BackCoverImages/Summer1995.gif',2,12,'\"In a dramatic confirmation of how vulnerable Defense Department computers connected to the Internet actually are, the Defense Information Systems Agency revealed that it has conducted mock attacks on more then 8,000 DOD computers over the last two years. The DISA team successfully broke into more than 88 percent of the computers. Less than 5 percent even realized they had been attacked.\" - Federal Computer Week, February 6, 1995.',60),(31,'Autumn',1995,'Page 13 an flyer for the Boston 2600 meetings that is not in the index.','FrontCoverImages/Autumn1995.gif','BackCoverImages/Autumn1995.gif',3,12,'\"The threat that contemporary electronic intruders pose to the PSN [Public Switched Network] is rapidly changing and is significant. As a result of their increasing knowledge and sophistication, electronic intruders amy have a significant impact upon national security and emergency preparedness (NS/EP) telecommunications, because more than 90 percent of U.S. Government telecommunications services are provided by commercial carriers. ...technological changes and market forces in the domestic telecommunications industry are fueling a trend toward increasing automation and downsizing of staff. Consequently, there are now greater numbers of current and former telecommunications employees who may be disgruntled than at any time in recent years. These individuals should be viewed as a potential threat to NS/EP telecommunications.\" - The Electronic Intrusion Threat to National Security and Emergency Preparedness Telecommunications, published by National Communications System of Arlington, VA and leaked to us by a disgruntled employee.',60),(32,'Winter',1995,'Pages 10 and 11 contain an alleged AOL memo, that is not in the index.','FrontCoverImages/Winter1995.gif','BackCoverImages/Winter1995.gif',4,12,'\"All speech is not protected by the First Amendment.\" - Senator Arlen Specter (R-Pa.)',56),(33,'Spring',1996,'Page 8 contains a copy of a letter from MCI and page 21 contains Nokia 100 series telephone programming instructions that are not in the index.','FrontCoverImages/Spring1996.gif','BackCoverImages/Spring1996.gif',1,13,'\"It\'s not a computer crime to break into someone\'s system and just look around.\" - Susan Lloyd, a spokesperson for the FBI\'s Washington DC field office as quoted in the March 10, 1996 Boston Herald.',56),(34,'Summer',1996,NULL,'FrontCoverImages/Summer1996.gif','BackCoverImages/Summer1996.gif',2,13,'\"If we\'re going to live in this kind of world, we\'re going to have to link the intelligence world with law enforcement.\" - Senator Sam Nunn (D., Ga.) on a proposal to give the CIA power to begin domestic monitoring of U.S. citizens.',60),(35,'Autumn',1996,'Page 54 and 55 show pictures of hacked web sites and are not in the index.','FrontCoverImages/Autumn1996.gif','BackCoverImages/Autumn1996.gif',3,13,'\"Attacks on Defense computer systems are a serious and growing threat. The exact number of attacks cannot be readily determined because only a small portion are actually detected and reported. However, Defense Information Systems Agency (DISA) data implies that Defense may have experienced as many as 250,000 attacks last year. DISA information also shows that attacks are successful 65 percent of the time, and that the number of attacks is doubling each year, as Internet use increases along with the sophistication of \'hackers\' and their tools.\" - General Accounting Office report entitled \"Computer Attacks at Department of Defense Pose Increasing Risks\". It was later disclosed that the estimates were based on staged attacks from within the military.',60),(36,'Winter',1996,'Page 40 discusses an AT&T check that is not in the index.','FrontCoverImages/Winter1996.gif','BackCoverImages/Winter1996.gif',4,13,'\"Some of the computer attack tools, such as SATAN, are now so user-friendly that very little computer experience or knowledge is required to launch automated attacks on systems. Also, informal hacker groups, such as the 2600 club, the Legions of Doom, and Phrackers Inc., openly share information on the Internet about how to break into computer systems. This open sharing of information combined with the availability of user-friendly and powerful attack tools makes in relatively easy for anyone to learn how to attack systems or to refine their attack techniques.\" - General Accounting Office report entitled \"Computer Attacks at Department of Defense Pose Increasing Ricks\". The only names they got right in this quote were SATAN and Internet.',60),(37,'Spring',1997,'Page 12 shows an interesting book cover, page 26 shows an internal NYNEX Mobile memo, page 43 shows an exploit of INN, page 46 shows an addendum to Cracking AskSam in previous issue, none of which are in the index.','FrontCoverImages/Spring1997.gif','BackCoverImages/Spring1997.gif',1,14,'\"They have this myth that they are the cool guys and the cool guys always win over the suits. But the fact is that they are half-socialized, post-adolescents with serious ethical and moral boundary problems.\" - Mike Godwin of the Electronic Frontier Foundation commenting on hackers to the Associated Press, April 2, 1996.',60),(38,'Summer',1997,NULL,'FrontCoverImages/Summer1997.gif','BackCoverImages/Summer1997.gif',2,14,'\"They\'re self-described nerds, using one word names like \"Mudge\" or \"Dark Tangent\" and dressing all in  black.\" - The Associated Press in a July 12, 1997 report using their insight to describe hackers at the Defcon conference.',60),(39,'Autumn',1997,'Page 18 displays a fax, 22 displays a confidential memo ripped in two, page 29 displays an FOIA response.','FrontCoverImages/Autumn1997.gif','BackCoverImages/Autumn1997.gif',3,14,'\"First and foremost, every White House person who has got access to classified information knows that you should not ever transmit any classified material either by cellulor phone, non-protected phone, or by beeper. That is drilled into us fairly well. And as a general proposition, we are alerted to the sensitivity of all electronic communications - walkie-talkies, cellular phones, and beepers. And I think there are probably some staffers who now had a fairly painful reminder that these are indeed public transmissions. So their private matters are now more widely known. It probably will be a useful deterrent.\" - White House Press Secretary Mike McCurry commenting September 22, 1997 on the release by 2600 staffers of White House pager transmissions. He seems to agree with us that these are indeed \"public transmissions.\" Maybe he can get the word to Louis Freeh.',60),(40,'Winter',1997,NULL,'FrontCoverImages/Winter1997.gif','BackCoverImages/Winter1997.gif',4,14,'\"As a matter of policy, AT&T safeguards customer information from unauthorized access. It is also our policy to allow business customers to access their account-billing records to check the accuracy of their records and to request changes, as necessary, by using an automated system. Until now, questions such as yours have never come up, so we want to thank you very much for bringing your concerns to our attention.\" - an AT&T media relations representative responding to a member of the Privacy Forum\'s (www.vortex.com) revelation that their automated service intended to reveal the owner of a telephone number dialed on a customer\'s bill instead revelas anyone\'s number at anytime to anyone, listed or unlisted.',60),(41,'Spring',1998,NULL,'FrontCoverImages/Spring1998.gif','BackCoverImages/Spring1998.gif',1,15,'\"What Kevin Mitnick is about is creating a mythology of a hacker threat and using that threat to expand the government\'s statutory authority and increase its wiretapping capability. Find me an individual who was hurt. Find me a company that was hurt. The most you can say is that some companies had to close security holes... and arguably they would have had to do that anyway.\" - Mike Godwin, staff counsel for the Electronic Freedom Foundation.',60),(42,'Summer',1998,'Page 11 has information about an FBI ANSIR fax, page 21 has a 3Com security advisory, page 22 has information on the Sentex Ovation System, page 24 has an AT&T letter and page 25 has a lawsuit threatening letter from the International Churches of Christ that are not in the index.','FrontCoverImages/Summer1998.gif','BackCoverImages/Summer1998.gif',2,15,'\"At this moment I do not have a personal relationship with a computer... it got so confusing, as to what was on the computer, what wasn\'t on the computer, what was on the hard drive, what was on the soft drive, that it made it easier for me just to do my work with pen and pencil.\" - Attorney General Janet Reno, May 24, 1998.',60),(43,'Autumn',1998,'Page 55 contains a fax from a user that is not in the index.','FrontCoverImages/Autumn1998.gif','BackCoverImages/Autumn1998.gif',3,15,'\"This is not a tool we should take seriously, or our customers should take seriously.\" - Edmund Muth of Microsoft, reacting to the release of Back Orifice, a program that attacks Windows 95/98 with a vengeance, by the Cult of the Dead Cow, as reported in the New York Times. We should point out that they said this BEFORE the program was released.',60),(44,'Winter',1998,NULL,'FrontCoverImages/Winter1998.gif','BackCoverImages/Winter1998.gif',4,15,'\"We will not engage in any assaults or hostile physical contact, physical intimidation, verbal threats of physical harm or violence, or any other actions that are threatening or hostile in nature. We will not carry weapons onto company property, in company vehicles, or while conducting company business, even if we have a permit or license to carry them.\" - Page 17 of the Bell Atlantic Code of Business Conduct.',60),(45,'Spring',1999,'This issue is dedicated to the memory of Walter. August, 1985 to March, 1999.','FrontCoverImages/Spring1999.gif','BackCoverImages/Spring1999.gif',1,16,'\"We already are seeing the first wave of deliberate cyber attacks - hackers break into government and business computers, stealing and destroying information, raiding bank accounts, running up credit card charges, extorting money by threats to unleash computer viruses.\" - President Bill Clinton, the most powerful man on earth, declaring war on hackers in a speech at the National Academy of Sciences, 1/22/99.',60),(46,'Summer',1999,NULL,'FrontCoverImages/Summer1999.gif','BackCoverImages/Summer1999.gif',2,16,'\"Public disclosure and dissemination of the victim loss letters was clearly designed to cause additional injury to the victims of defendant\'s conduct or to cause such victims embarrassment or ridicule.\" - 5/6/99, from a motion filed by the prosecution in the Kevin Mitnick case after letters obtained by 2600 were made public - these letters claimed that Mitnick, simply by looking at some source code, managed to cost cellular phone companies several hundred million dollars, a huge figure that was never reported to the companies\' stockholders, as is required by law.',60),(47,'Autumn',1999,'Page 47 contains news of the shutdown of Satellite Watch News by DirecTV.','FrontCoverImages/Autumn1999.gif','BackCoverImages/Autumn1999.gif',3,16,'\"He is a strange, in some senses pathetic, misguided human being. I don\'t hold a lot of confidence that he will turn his life around.\" - Mitnick prosecutor David Schindler, now heading for a lucrative position in the law firm Latham & Watkins, on the subject of Kevin Mitnick, as quoted in the Los Angeles Times 8/16/99.',60),(48,'Winter',1999,'Page 42 contains a DOJ letter concerning Kevin Mitnick that is not in the index.','FrontCoverImages/Winter1999.gif','BackCoverImages/Winter1999.gif',4,16,'\"Hacking can get you in a whole lot more trouble than you think and is a completely creepy thing to do.\" - DOJ web page aimed at kids to discourage hacking (www.usdoj.gov/kidspage/do-dont/reckless.htm)',60),(49,'Spring',2000,NULL,'FrontCoverImages/Spring2000.gif','BackCoverImages/Spring2000.gif',1,17,'\"If we have to file a thousand lawsuits a day, we\'ll do it.\" - Jack Valenti, head of the MPAA, referring to the steps they will take to silence those spreading the DeCSS source code.',60),(50,'Summer',2000,'Page 46 article has no title, should be \"The Privacy Box\".','FrontCoverImages/Summer2000.gif','BackCoverImages/Summer2000.gif',2,17,'\"Posting information about MPAA\'s anti-privacy operations and techniques will make that information easily available to those engaged in, or planning for, digital piracy of individual works.\" - MPAA\'s \"Director of Anti-Priacy, Worldwide\" Kenneth A. Jacobsen in a filing to the court to prevent the media and the public from learning what they ar saying in pre-trail depositions. He really did say \"anti-privacy operations\" in his filing. Freudian slip? You decide.',60),(51,'Autumn',2000,'Page 12 is a letter from CBS,  Page 22 is a letter from Warner Brothers and page 42 is a letter from Microsoft that are not in the index.','FrontCoverImages/Autumn2000.gif','BackCoverImages/Autumn2000.gif',3,17,'\"Anyone wishing to make lawful use of a particular movie may buy or rent a videotape, play it, and even copy all or part of it with readily available equipment.\" - Judge Lewis A. Kaplan\'s way of dealing with the fact that it\'s virtually impossible to do this with a DVD - his apparent solution is to just go back and use old technology that isn\'t subject to insane laws.',60),(52,'Winter',2000,'Page 53 is a note about registering host names for fun that is not in the index.','FrontCoverImages/Winter2000.gif','BackCoverImages/Winter2000.gif',4,17,'\"I think any time you expose vulnerabilities it\'s a good thing.\" - United States Attorney General Janet Reno, May 2000 in response to security breaches uncovered by federal agents.',60),(53,'Spring',2001,NULL,'FrontCoverImages/Spring2001.gif','BackCoverImages/Spring2001.gif',1,18,'\"Why is it perfectly legal to post a diagram of how to build a bomb on the net, but you can\'t post a code that descrambles DVDs?\" - The March 3, 2001 edition of \"Boondocks\", a daily comic strip written and drawn by Aaron McGruder and seen in newspapers all over the country. It devoted three days to the DeCSS controversy and, unlike virtually all news reports, got the story right.',60),(54,'Summer',2001,NULL,'FrontCoverImages/Summer2001.gif','BackCoverImages/Summer2001.gif',2,18,'\"Handing over the digital spectrum, or for that matter the Internet, to private power - that\'s a huge blow against democracy. In the case of the Internet, it\'s a particularly dramatic blow against democracy because this was paid for by the public. How undemocratic can you get? Here is a major instrument, developed by the public - first part of the Pentagon, and then universities and the National Science Foundation - handed over in some manner that nobody knows to private corporations who want to turn it into an instrument of control. They want to turn it into a home shopping center. You know, where it will help them convert you into the kind of person they want. Namely, someone who is passive, apathetic, sees their life only as a matter of having more commodities that they don\'t want. Why give them a powerful weapon to turn you into that kind of a person? Especially after you paid for the weapon? Well, that\'s what\'s happening right in front of our eyes.\" - Noam Chomksy, linguist and political dissident, from an interview with the Boston Phoenix in 1999.',60),(55,'Autumn',2001,NULL,'FrontCoverImages/Autumn2001.gif','BackCoverImages/Autumn2001.gif',3,18,'\"We all have to fight against the hacker community.\" - Judy Elder of Microsoft Canada, as quoted by the CBC, July 31, 2001.',60),(56,'Winter',2001,NULL,'FrontCoverImages/Winter2001.gif','BackCoverImages/Winter2001.gif',4,18,'\"Publication that is deemed to be a threat to legitimate penological objectives.\" - State of Washington Department of Corrections, 2001.',60),(57,'Spring',2002,NULL,'FrontCoverImages/Spring2002.gif','BackCoverImages/Spring2002.gif',1,19,'\"I realize that this bill basically says you can tap someone\'s phone for jaywalking, and normally I would say, \'No way.\' But after what happened on September 11th, I say screw \'em.\" - Dana Lee Dembrow, Democratic member of the Maryland House of Delegates explaining her approval of a new bill that would greatly expand the ability of authorities to monitor e-mail and telephone traffic. Jaywalkers beware.',60),(58,'Summer',2002,NULL,'FrontCoverImages/Summer2002.gif','BackCoverImages/Summer2002.gif',2,19,'\"People who go to places of worship, people who go to libraries, people who are in chat rooms, are going to have \'Big Brother\' listening in even though there\'s no evidence that they are involved in anything illegal whatsoever.\" - Laura Murphy, spokeswoman for the American Civil Liberties Union on the new surveillance powers given to the FBI.',60),(59,'Autumn',2002,'Page 13 has a copy of a letter from Direct Media America and page 24 a copy of a letter from Comcast that are not in the index.','FrontCoverImages/Autumn2002.gif','BackCoverImages/Autumn2002.gif',3,19,'\"What amazes me is that there are thousands of people who could have been whistle-blowers, from the boards of directors to corporate insiders to the accounting firms to the lawyers working for these firms to the credit-rating agencies. All these people! Would a despotic dictatorship have been more efficient in silencing them and producing the perverse incentives for them all to keep quiet? The system is so efficient that there\'s total silence. I mean, the Soviet Union had enough dissidents to fill Gulags.\" - Ralph Nader on the continuing corporate crime wave in the United States.',60),(60,'Winter',2002,'Page 11 has a copy of a check with an explanation, page 14 has a copy of a letter from the U.S. Department of Justice, page 24 has info about questionable Sprint billing practices, that are not in the index.','FrontCoverImages/Winter2002.gif','BackCoverImages/Winter2002.gif',4,19,'\"Voice or no voice, the people can always be brought to the bidding of the leaders. That is easy. All you have to do is tell them they are being attacked, and denounce the peacemakers for lack of patriotism and exposing the country to danger. It works the same in any country.\" - Hermann Goering, Hitler\'s designated successor, before being sentenced to death at the Nuremberg trials.',60),(61,'Spring',2003,'Page 23 is a copy of a Warner Bros. letter that is not in the index.','FrontCoverImages/Spring2003.gif','BackCoverImages/Spring2003.gif',1,20,'\"...the essence of the evil government is that it anticipates bad conduct on the part of its citizens. Any government which assumes that the population is going to do something evil has already lost its franchise to govern. The tacit contract between a government and the people governed is that the government will trust the people and the people will trust the government. But once the government begins to mistrust the people it is governing, it loses its mandate to rule because it is no longer acting as a spokesman for the people, but is acting as an agent of persecution.\" - Philip K. Dick',60),(62,'Summer',2003,'Page 13 has a picture of an Internet payphone and page 29 a picture of a \"Homeland Security\" business truck that are not in the index.','FrontCoverImages/Summer2003.gif','BackCoverImages/Summer2003.gif',2,20,'\"Television taught people to watch \'Friends\' rather than have friends. Today, relatively little of our leisure time is spent interacting with other people. Now we spend it observing machines.\" - Robert B. Putnam, author of Bowling Alone',60),(63,'Autumn',2003,'Page 8 has a picture courtesy of Internet Qatar that is not in the index.','FrontCoverImages/Autumn2003.gif','BackCoverImages/Autumn2003.gif',3,20,'\"I do know I\'m ready fo the job. And, if not, that\'s just the way it goes.\" - George W. Bush, August 21, 2000',60),(64,'Winter',2003,'Page 25 has a picture of an interesting ad that is not in the index.','FrontCoverImages/Winter2003.gif','BackCoverImages/Winter2003.gif',4,20,'\"No one realized that the pumps that delivered fuel to the emergency generators were electric.\" - Angel Feliciano, representative of Verizon workers explaining why Verizon\'s backup power failed during the August 14 blackout causing disruption to the 911 service.',60),(65,'Spring',2004,NULL,'FrontCoverImages/Spring2004.gif','BackCoverImages/Spring2004.gif',1,21,'\"We have never had vulnerabilities exploited before the patch was known.\" - David Aucsmith, head of technology at Microsoft\'s security business and technology unit, February 2004.',60),(66,'Summer',2004,NULL,'FrontCoverImages/Summer2004.gif','BackCoverImages/Summer2004.gif',2,21,'\"Men are only as good as their technical development allows them to be.\" - George Orwell',60),(67,'Autumn',2004,NULL,'FrontCoverImages/Autumn2004.gif','BackCoverImages/Autumn2004.gif',3,21,'\"We are stunned that RealNetworks has adopted the tactics and ethics of a hacker to break into the iPod, and we are investigating the implications of their actions under the DMCA and other laws.\" - Apple Computer in an apparent reversal of their \"think different\" marketing strategy, July 29, 2004',60),(68,'Winter',2004,NULL,'FrontCoverImages/Winter2004.gif','BackCoverImages/Winter2004.gif',4,21,'\"We cannot simply suspend or restrict civil liberties until the War of Terror is over, because the War on Terror is unlikely ever to be truly over.\" - Judge Gerald Tjoflat of the 11th U.S. Circuit Court of Appeals, October 15, 2004.',60),(69,'Spring',2005,NULL,'FrontCoverImages/Spring2005.gif','BackCoverImages/Spring2005.gif',1,22,'\"If tyranny and oppression come to this land, it will be in the guise of fighting a foreign enemy.\" - James Madison',64),(70,'Summer',2005,NULL,'FrontCoverImages/Summer2005.gif','BackCoverImages/Summer2005.gif',2,22,'\"No government can be long secure without a formidable opposition.\" - Benjamin Disraeli',64),(71,'Autumn',2005,NULL,'FrontCoverImages/Autumn2005.gif','BackCoverImages/Autumn2005.gif',3,22,'\"The good news is - and it\'s hard for some to see it now - that out of this chaos is going to come a fantastic Gulf Coast, like it was before. Out of the rubbles of Trent Lott\'s house - he\'s lost his entire house - there\'s going to be a fantastic house. And I\'m looking forward to sitting on the porch.\" -  George W. Bush, touring hurricane damage that at press time was estimated to have killed thousands of people, Sept. 2, 2005',64),(72,'Winter',2005,'Page 61 has the Easter Egg Hunt contest results with a complete list of the Easter Eggs in Freedom Downtime, that is not in the index.','FrontCoverImages/Winter2005.gif','BackCoverImages/Winter2005.gif',4,22,'\"Value your freedom, or you will lost it, teaches history. \'Don\'t bother us with politics,\' respond those who don\'t want to learn.\" - Richard Stallman',64),(73,'Spring',2006,NULL,'FrontCoverImages/Spring2006.gif','BackCoverImages/Spring2006.gif',1,23,'\"Unthinking respect for authority is the greatest enemy of truth.\" - Albert Einstein',64),(74,'Summer',2006,NULL,'FrontCoverImages/Summer2006.gif','BackCoverImages/Summer2006.gif',2,23,'\"Are you telling me that tens of millions of Americans are involved with al Qaeda?\" - Senator Patrick Leahy in response to recent revelations that the NSA has been secretly attempting to create a database of every call ever made within U.S. borders.',64),(75,'Autumn',2006,NULL,'FrontCoverImages/Autumn2006.gif','BackCoverImages/Autumn2006.gif',3,23,'\"An internet was sent by my staff at 10 o\'clock in the morning Friday. I got it yesterday. Why?\" - Senator Ted Stevens displaying his knowledge of the Internet earlier this summer in a speech designed to help defeat the network neutrality initiative.',64),(76,'Winter',2006,NULL,'FrontCoverImages/Winter2006.gif','BackCoverImages/Winter2006.gif',4,23,'\"It has become appallingly obvious that our technology has exceeded our humanity.\" -  Albert Einstein',68),(77,'Spring',2007,NULL,'FrontCoverImages/Spring2007.gif','BackCoverImages/Spring2007.gif',1,24,'\"The production of too many useful things results in too many useless people.\" - Karl Marx',68),(78,'Summer',2007,NULL,'FrontCoverImages/Summer2007.gif','BackCoverImages/Summer2007.gif',2,24,'\"Once a new technology rolls over you, if you\'re not part of the steamroller, you\'re part of the road.\" - Stewart Brand',68),(79,'Autumn',2007,NULL,'FrontCoverImages/Autumn2007.gif','BackCoverImages/Autumn2007.gif',3,24,'\"The price good men pay for indifference to public affairs is to be ruled by evil men.\" - Plato',68),(80,'Winter',2007,NULL,'FrontCoverImages/Winter2007.gif','BackCoverImages/Winter2007.gif',4,24,'\"First they ignore you, then they laugh at you, then they fight you, then you win.\" - Mahatma Gandhi',68),(81,'Spring',2008,NULL,'FrontCoverImages/Spring2008.gif','BackCoverImages/Spring2008.gif',1,25,'\"The bigger the lie, the more they believe.\" - Bunk',68),(82,'Summer',2008,NULL,'FrontCoverImages/Summer2008.gif','BackCoverImages/Summer2008.gif',2,25,'\"There\'s no place like HOPE.\" - random Last HOPE attendee, July 2008',68),(83,'Autumn',2008,NULL,'FrontCoverImages/Autumn2008.gif','BackCoverImages/Autumn2008.gif',3,25,'\"We live in a society exquisitely dependent on science and technology, in which hardly anyone knows anything about science and technology.\" - Carl Sagan',68),(84,'Winter',2008,NULL,'FrontCoverImages/Winter2008.gif','BackCoverImages/Winter2008.gif',4,25,'\"I think we agree, the past is over.\" - George W. Bush',68),(85,'Spring',2009,NULL,'FrontCoverImages/Spring2009.gif','BackCoverImages/Spring2009.gif',1,26,'\"It\'s not just enough to change the players. We\'ve gotta change the game.\" - Barack Obama',68),(86,'Summer',2009,NULL,'FrontCoverImages/Summer2009.gif','BackCoverImages/Summer2009.gif',2,26,'\"The future is here. It\'s just not evenly distributed yet.\" - William Gibson',68),(87,'Autumn',2009,NULL,'FrontCoverImages/Autumn2009.gif','BackCoverImages/Autumn2009.gif',3,26,'\"There is no need for any individual to have a computer in their home.\" - Ken Olsen, president, Digital Equipment Corp., 1977',68),(89,'Winter',2009,NULL,'FrontCoverImages/Winter2009.gif','BackCoverImages/Winter2009.gif',4,26,'\"The most exciting phrase to hear in science, the one that heralds the most discoveries, is not \'Eureka!\' but \'That\'s funny...\'\" - Isaac Asimov',68),(92,'December',1987,NULL,'FrontCoverImages/December1987.gif','BackCoverImages/December1987.gif',12,4,NULL,24),(93,'November',1987,'Page 2 (and part of 10/21) has info from 2600, Page 11 has a copy of a letter from MCI Telecommunications and some comments, pages 14 and 15 are ads.','FrontCoverImages/November1987.gif','BackCoverImages/November1987.gif',11,4,'',24),(94,'October',1987,'Page 2 has info from 2600, that is not in the index.','FrontCoverImages/October1987.gif','BackCoverImages/October1987.gif',10,4,'',24),(103,'September',1987,'Page 2 (and part of 16) has info from 2600, that is not in the index.','FrontCoverImages/September1987.gif','BackCoverImages/September1987.gif',9,4,'',24),(104,'August',1987,'Page 16 has a letter from Telenet Communications Corporation, page 17 has a bill from US Sprint, that are not in the index.','FrontCoverImages/August1987.gif','BackCoverImages/August1987.gif',8,4,NULL,24),(105,'July',1987,'Page 2 (and part of 20) has info from 2600, page 9 announces the 2600 answer the phone contest, page 17 has some 1950\'s telephone company propaganda, that are not in the index.','FrontCoverImages/July1987.gif','BackCoverImages/July1987.gif',7,4,'',24),(106,'June',1987,'Page 2 has info from 2600, that is not in the index.','FrontCoverImages/June1987.gif','BackCoverImages/June1987.gif',6,4,'',24),(107,'May',1987,'Page 2 has info from 2600, that is not in the index.','FrontCoverImages/May1987.gif','BackCoverImages/May1987.gif',5,4,'',24),(108,'April',1987,'Page 2 has info from 2600, that is not in the index.','FrontCoverImages/April1987.gif','BackCoverImages/April1987.gif',4,4,'',24),(109,'March',1987,'Page 2 has info from 2600