If journalism is good, it is controversial by it\'s nature.\" - Julian Assange',68),(154,'Autumn',2011,'','FrontCoverImages/Autumn2011.gif','BackCoverImages/Autumn2011.gif',3,28,'\"Knowing is not enough; we must apply. Being willing is not enough; we must do.\" - Leonardo da Vinci',68),(155,'Winter',2011,NULL,'FrontCoverImages/Winter2011.gif','BackCoverImages/Winter2011.gif',4,28,'\"Nowadays people know the price of everything and the value of nothing.\" - Oscar Wilde=',68),(156,'Spring',2012,'','FrontCoverImages/Spring2012.gif','BackCoverImages/Spring2012.gif',1,29,'\"The surest way to corrupt a youth is to instruct him to hold in higher esteem those who think alike than those who think differently.\" - Friedrich Nietzsche',68),(157,'Summer',2012,'','FrontCoverImages/Summer2012.gif','BackCoverImages/Summer2012.gif',2,29,'\"The Department of Justice does not endorse the organizations or views represented by this site and takes no responsibility for, and exercises no control over, the accuracy, accessibility, copyright or trademark compliance or legality of the material contained on this site.\" Message on the Department of Justice website that appears when a visitor clicks on a link. This same agency routinely shuts down websites because of links they find objectionable.',68),(158,'Autumn',2012,'','FrontCoverImages/Autumn2012.gif','BackCoverImages/Autumn2012.gif',3,29,'\"If you only knew the magnificence of the 3, 6 and 9, then you would have the key to the universe.\" - Nikola Tesla',68),(159,'Winter',2012,'','FrontCoverImages/Winter2012.gif','BackCoverImages/Winter2012.gif',4,29,'\"The best way to predict the future is invent it.\" - Alan Kay',68),(160,'Spring',2013,'','FrontCoverImages/Spring2013.gif','BackCoverImages/Spring2013.gif',1,30,'\"Be curious. Read widely. Try new things. What people call intelligence just boils down to curiosity.\" - Aaron Swartz',68),(161,'Summer',2013,'','FrontCoverImages/Summer2013.gif','BackCoverImages/Summer2013.gif',2,30,'\"I fear the day when the technology overlaps with our humanity. The world will only have a generation of idiots.\" - Attributed to Albert Einstein',68),(162,'Autumn',2013,'Page 64/65 contains A Response to \"Perfect Encryption - Old Style!\" by Phil instead of staff page and house ad. See <a href=\'article.php?i=161&a=2248\'>(..)</a>','FrontCoverImages/Autumn2013.gif','BackCoverImages/Autumn2013.gif',3,30,'',68),(163,'Winter',2013,'Index indicates an article \"Identity and Encryption Verification\" that doesn\'t exist.','FrontCoverImages/Winter2013.gif','BackCoverImages/Winter2013.gif',4,30,'\"If we can\'t understand the policies and the programs of our government, we cannot grant our consent in regulating them.\" - Edward Snowden',68),(164,'Spring',2014,'','FrontCoverImages/Spring2014.gif','BackCoverImages/Spring2014.gif',1,31,'\"Everybody gets so much information all day long that they lose their common sense.\" - Gertrude Stein, 1946.',68),(165,'Summer',2014,'','FrontCoverImages/Summer2014.gif','BackCoverImages/Summer2014.gif',2,31,'\"If you don\'t want to be replaced by a computer, don\'t act like one.\" - Physicist Arno Penzias, 1978',68),(166,'Autumn',2014,'','FrontCoverImages/Autumn2014.gif','BackCoverImages/Autumn2014.gif',3,31,'\"The thought of an entire population using computer terminals, not just the technologically literate minority, is truly revolutionary.\" 2600 in 1987',68),(167,'Winter',2014,'','FrontCoverImages/Winter2014.gif','BackCoverImages/Winter2014.gif',4,31,'\"There will come a time when it isn\'t \'They\'re spying on me through my phone\' anymore. Eventually, it will be \'My phone is spying on me.\'\" - Philip K. Dick, circa 1970s',68),(168,'Spring',2015,'','FrontCoverImages/Spring2015.gif','BackCoverImages/Spring2015.gif',1,32,'\"Journalism is printing what someone else does not want printed. Everything else is public relations\" - George Orwell',68),(169,'Summer',2015,'','FrontCoverImages/Summer2015.gif','BackCoverImages/Summer2015.gif',2,32,'\"The most technologically efficient machine that man has ever invented is the book.\" - Northrop Frye',68),(170,'Autumn',2015,'Magazine index page 2 missing LEAKED DOCUMENTS article.','FrontCoverImages/Autumn2015.gif','BackCoverImages/Autumn2015.gif',3,32,'\"There is very little that you will encounter in life that has not been infused with bullshit.\" - Jon Stewart, 2015',68),(174,'Winter',2015,'','FrontCoverImages/Winter2015.gif','BackCoverImages/Winter2015.gif',4,32,'\"We live in a society exquisitely dependent on science and technology, in which hardly anyone knows anything about science and technology.\" - Carl Sagan',68),(176,'Spring',2016,'Page 28 is a full page add for the eleventh HOPE.','FrontCoverImages/Spring2016.gif','BackCoverImages/Spring2016.gif',1,33,'\"The first condition of progress is the removal of censorship.\" - George Bernard Shaw',68),(179,'Summer',2016,'','FrontCoverImages/Summer2016.gif','BackCoverImages/Summer2016.gif',2,33,'\"We used to say a man\'s home is his castle. Today, a man\'s phone is his castle.\" - Edward Snowden',68),(181,'Autumn',2016,'','FrontCoverImages/Autumn2016.gif','BackCoverImages/Autumn2016.gif',3,33,'\"I have so many websites. I have them all over the place. I hire people, they do a website. It costs me $3.\" - Donald Trump',68),(183,'Winter',2016,'','FrontCoverImages/Winter2016.gif','BackCoverImages/Winter2016.gif',4,33,'\"If the government is taken over by evil, hackers will be indispensable friends fighting for our freedom.\" - xphreak',68),(185,'Spring',2017,'','FrontCoverImages/Spring2017.gif','BackCoverImages/Spring2017.gif',1,34,'\"Hacking is bad and it shouldn\'t be done. But look at the things that were hacked. Look at what was learned from that hacking.\" Donald Trump',68),(187,'Summer',2017,'','FrontCoverImages/Summer2017.gif','BackCoverImages/Summer2017.gif',2,34,'\"Truth is stranger than fiction, but it is because Fiction is obliged to stick to possibilities; Truth isn\'t\" - Mark Twain, 1897',68),(189,'Autumn',2017,'','FrontCoverImages/Autumn2017.gif','BackCoverImages/Autumn2017.gif',3,34,'\"I\'m here because I\'m a refugee.\" - Google co-founder Sergey Brin, 2017',68),(191,'Winter',2017,'','FrontCoverImages/Winter2017.gif','BackCoverImages/Winter2017.gif',4,34,'\"If I had to do it all over again, I would know a hell of a lot more about cybersecurity.\" - Donna Brazile',68),(193,'Spring',2018,'','FrontCoverImages/Spring2018.gif','BackCoverImages/Spring2018.gif',1,35,'\"Will the Internet become a theater, crowded with all of Humanity, where demagogic institutions cry \'fire\' every time they wish to incite a mob? Will the Global Village be dominated, like so many other small towns, by schadenfreudal busybodies who build their own self-esteem from the wreckage of others whose reputations they\'ve destroyed? So far, this has not happened because most of those in Cyberspace had a sense of responsibility about the preservation of a social contract that, however vague, was precious to us all. But what can be done about entities like Congress, who have neither a sense of the social contract nor enough stake in its preservation to motivate self-restraint?\" John Perry Barlow',68),(194,'Summer',2018,'','FrontCoverImages/Summer2018.gif','BackCoverImages/Summer2018.gif',2,35,'\"Are you a one or a zero?\" - Mr. Robot',68),(196,'Autumn',2018,NULL,'FrontCoverImages/Autumn2018.gif','BackCoverImages/Autumn2018.gif',3,35,NULL,68);
