INSERT INTO `Keywords` VALUES (1,'Editorial','An article that expresses the opinion of the editor, editorial board, or publisher.','http://en.wikipedia.org/wiki/Editorial'),(2,'Letters','Letter to the editor, sent to 2600 about issues of concern to the readers.','http://en.wikipedia.org/wiki/Letters_to_the_editor'),(3,'Virus','Computer virus, a computer program that can copy itself and infect a computer without permission or knowledge of the user.','http://en.wikipedia.org/wiki/Computer_virus'),(4,'Exploit','A piece of software, a chunk of data, or sequence of commands that take advantage of a bug, glitch or vulnerability in order to cause unintended or unanticipated behavior to occur on computer software, hardware, or something electronic (usually computerized). This frequently includes such things as violently gaining control of a computer system or allowing privilege escalation or a denial of service attack.','http://en.wikipedia.org/wiki/Exploit_(computer_security)'),(5,'Hack','A clever or quick fix to a computer program problem, or to a clumsy or inelegant solution to a problem. The term is also used to refer to a modification of a program or device to give the user access to features that were otherwise unavailable. The general media also uses this term to describe the act of illegally breaking into a computer, better described as cracking.','http://en.wikipedia.org/wiki/Hack_(technology)'),(6,'Phreaking','A slang term coined to describe the activity of a subculture of people who study, experiment with, or explore telecommunication systems.','http://en.wikipedia.org/wiki/Phreaking'),(7,'Tor','The Onion Router\r\n(anonymity network)\r\nhttp://www.torproject.org/','http://en.wikipedia.org/wiki/Tor_(anonymity_network)'),(8,'Pen Testing','Penetration testing, a method of evaluating the security of a computer system or network by simulating an attack by a malicious user.','http://en.wikipedia.org/wiki/Pen_testing'),(9,'Ripping','The process of copying audio or video content to a hard disk or other media.','http://en.wikipedia.org/wiki/Ripping'),(10,'MP3','MPEG-1 Audio Layer 3, a digital audio encoding format using a form of lossy data compression.','http://en.wikipedia.org/wiki/Mp3'),(11,'SEO','Search engine optimization is the process of improving the volume and quality of traffic to a web site from search engines via \"natural\" (\"organic\" or \"algorithmic\") search results.','http://en.wikipedia.org/wiki/Search_engine_optimization'),(12,'Hackerspace','A hackerspace or hackspace (from Hacker and Space) is a real (as opposed to virtual) place where people with common interests, usually in science, technology, or digital or electronic art can meet, socialise and collaborate.','http://en.wikipedia.org/wiki/Hackerspace'),(13,'Fiction','The telling of stories which aren\'t real.','http://en.wikipedia.org/wiki/Fiction'),(14,'Port Scanning','Searching network host(s) for open port(s).','http://en.wikipedia.org/wiki/Port_scanning'),(15,'OS fingerprinting','Process of determining the operating system (OS)/server software used by a remote system.','http://en.wikipedia.org/wiki/OS_fingerprinting'),(16,'Remote Scripting','A technology which allows scripts running inside a browser to exchange information with a server.','http://en.wikipedia.org/wiki/Remote_Scripting'),(17,'Scripting','A programming language that controls a software application.','http://en.wikipedia.org/wiki/Scripting'),(18,'Disguise','To alter the appearance or hide the identity of someone/thing.',NULL),(19,'Cellphone','Also called a mobile phone and handphone, is an electronic device used for mobile telecommunications (mobile telephony, text messaging or data transmission) over a cellular network of specialized base stations known as cell sites.','http://en.wikipedia.org/wiki/Mobile_phone'),(20,'Forensics','A branch of forensic science pertaining to legal evidence found in computers and digital storage mediums.','http://en.wikipedia.org/wiki/Computer_forensics'),(21,'WEP','Wired Equivalent Privacy is a deprecated algorithm to secure IEEE 802.11 wireless networks.','http://en.wikipedia.org/wiki/Wired_Equivalent_Privacy'),(22,'Wireless Networks','Refers to any type of computer network that is wireless, typically using radio waves.','http://en.wikipedia.org/wiki/Wireless_networks'),(23,'DNS','Domain Name System, Internet system to translate names into IP addresses.','http://en.wikipedia.org/wiki/Domain_Name_System'),(24,'Firewall','Hardware/software designed to prevent unauthorized electronic access to a networked computer system.','http://en.wikipedia.org/wiki/Firewall'),(25,'Google','An American public corporation, earning revenue from advertising related to its Internet search, e-mail, online mapping, office productivity, social networking, and video sharing services. They also track people\'s internet use and blatantly disregard personal privacy!','http://en.wikipedia.org/wiki/Google'),(26,'800 number','A special telephone number, in that the called party is charged the cost of the calls by the telephone carrier, instead of the calling party.','http://en.wikipedia.org/wiki/800_numbers'),(27,'Cyberspace','The online world of computer networks and especially the Internet.','http://en.wikipedia.org/wiki/Cyberspace'),(28,'Music','The art of ordering tones or sounds in succession, in combination, and in temporal relationships to produce a composition having unity and continuity.','http://en.wikipedia.org/wiki/Music'),(29,'Network','A group of interconnected computers.','http://en.wikipedia.org/wiki/Computer_network'),(30,'ISP','Internet service provider - a company which offers their customers access to the Internet.','http://en.wikipedia.org/wiki/ISP'),(31,'Linux','A Unix-like computer operating system family which uses the Linux kernel and the GNU system utilities and libraries.','http://en.wikipedia.org/wiki/Linux'),(32,'Social Engineering','The art of manipulating people into performing actions or divulging confidential information.','http://en.wikipedia.org/wiki/Social_engineering_(security)'),(33,'History','A record or narrative description of past events.','http://en.wikipedia.org/wiki/History'),(34,'Security Tools','Computer programs useful for maintaining/assessing security on computers and networks.','http://sectools.org/'),(35,'Mind-Body','The interrelationship between physical and mental health.','http://en.wikipedia.org/wiki/Mind-body_connection'),(36,'Graffiti','Images or lettering scratched, scrawled, painted or marked in any manner on property.','http://en.wikipedia.org/wiki/Graffiti'),(37,'Lock Picking','The art of unlocking a lock by analyzing and manipulating the components of the lock device, without the original key.','http://en.wikipedia.org/wiki/Lock_Picking'),(38,'Honeypot','A trap set to detect or deflect attempts at unauthorized use of information systems.','http://en.wikipedia.org/wiki/Honeypot_(computing)'),(39,'Password Cracking','The process of discovering the plaintext of an encrypted computer password.','http://en.wikipedia.org/wiki/Password_cracking'),(40,'Javascript','A scripting language widely used for client-side web development.','http://en.wikipedia.org/wiki/Javascript'),(41,'Computer Security','The protection of information from theft or corruption, or the preservation of availability.','http://en.wikipedia.org/wiki/Computer_Security'),(42,'VoIP','Voice Over Internet Protocol - the transmission technologies for delivery of voice communications over the Internet.','http://en.wikipedia.org/wiki/Voip'),(43,'Telecommunications','The assisted transmission of signals over a distance for the purpose of communication.','http://en.wikipedia.org/wiki/Telecommunications'),(44,'Passwords','A secret word or string of characters that is used for authentication, to prove identity or gain access to a resource.','http://en.wikipedia.org/wiki/Passwords'),(45,'RFID','Radio-Frequency IDentification - an automatic identification method, relying on storing and remotely retrieving data using devices called RFID tags or transponders.','http://en.wikipedia.org/wiki/Rfid'),(46,'Barcode','A bar code is an optical machine-readable representation of data.','http://en.wikipedia.org/wiki/Barcode'),(47,'April Fools\' Day','A day marked by the commission of hoaxes and other practical jokes of varying sophistication on friends, family members, enemies and neighbors.','http://en.wikipedia.org/wiki/April_Fools%27_Day'),(48,'Privacy','The ability of an individual or group to seclude themselves or information about themselves and thereby reveal themselves selectively.','http://en.wikipedia.org/wiki/Privacy'),(49,'Proxy','A computer system or an application program that services the requests of its clients by forwarding requests to other servers.','http://en.wikipedia.org/wiki/Proxy_server'),(50,'Stacking','A gang signal made with the hands.','http://en.wikipedia.org/wiki/Gang_signal'),(51,'Alias','An assumed name (pseudonym).',NULL),(52,'Surveillance','Monitoring the behavior of people, objects or processes.','http://en.wikipedia.org/wiki/Surveillance'),(53,'Wikipedia','The free encyclopedia that anyone can edit.','http://en.wikipedia.org/wiki/Wikipedia'),(54,'Warez','Refers primarily to copyrighted works traded in violation of copyright law.','http://en.wikipedia.org/wiki/Warez'),(55,'Darknet','A private virtual network where users connect only to people they trust.','http://en.wikipedia.org/wiki/Darknet_(file_sharing)'),(56,'Satellite TV/radio','Television/radio delivered by the means of communications satellites.','http://en.wikipedia.org/wiki/Satellite_television\r\nhttp://en.wikipedia.org/wiki/Satellite_radio'),(57,'Encryption','The process of transforming information (referred to as plaintext) using an algorithm (called cipher) to make it unreadable to anyone except those possessing special knowledge, usually referred to as a key.','http://en.wikipedia.org/wiki/Encryption'),(58,'Electronic Voting','Is a term encompassing several different types of voting, embracing both electronic means of casting a vote and electronic means of counting votes.','http://en.wikipedia.org/wiki/Electronic_voting'),(59,'Facebook','A popular, free-access social networking website.','http://en.wikipedia.org/wiki/Facebook'),(60,'Paypal','An e-commerce business allowing payments and money transfers to be made through the Internet. They are a bunch of crooks whose service sucks!','http://en.wikipedia.org/wiki/Paypal'),(61,'DRM','Digital rights management - technologies which provide access control for digital media.','http://en.wikipedia.org/wiki/Digital_rights_management'),(62,'Drugs','Any chemical substance that, when absorbed into the body of a living organism, alters normal bodily function.','http://en.wikipedia.org/wiki/Drugs'),(63,'IDS','Intrusion Detection System - software and/or hardware designed to detect unwanted attempts at accessing, manipulating, and/or disabling of computer systems, mainly through a network.','http://en.wikipedia.org/wiki/Intrusion_detection_system'),(64,'Web Filtering','Software designed and optimized for controlling what content is permitted to a reader.','http://en.wikipedia.org/wiki/Web_filtering'),(65,'Multiboot','The act of installing multiple operating systems on a computer, and being able to choose which one to boot.','http://en.wikipedia.org/wiki/Multiboot'),(66,'Net Neutrality','A network that is free of restrictions on content, sites, or platforms, on the kinds of equipment that may be attached, and on the modes of communication allowed, as well as one where communication is not unreasonably degraded by other communication streams.','http://en.wikipedia.org/wiki/Net_Neutrality'),(67,'Election','A decision-making process by which a population chooses an individual to hold formal office.','http://en.wikipedia.org/wiki/Election'),(68,'craigslist','A central network of online communities, featuring free online classified advertisements and forums on various topics.','http://en.wikipedia.org/wiki/CraigsList'),(69,'Anonymity','The quality or state of being anonymous; anonymousness.','http://en.wikipedia.org/wiki/Anonymity'),(70,'Dumpster Diving','The practice of sifting through commercial or residential trash to find items that have been discarded by their owners, but which may be useful to the Dumpster diver.','http://en.wikipedia.org/wiki/Dumpster_Diving'),(71,'Quantum computing','A device for computation that makes direct use of quantum mechanical phenomena, such as superposition and entanglement, to perform operations on data.','http://en.wikipedia.org/wiki/Quantum_computing'),(72,'News','The reporting of current information on television and radio, and in newspapers and magazines.','http://en.wikipedia.org/wiki/News'),(73,'Business Intelligence','(BI) refers to skills, knowledge, technologies, applications, quality, risks, security issues and practices used to help a business to acquire a better understanding of the market behavior and business context.','http://en.wikipedia.org/wiki/Business_Intelligence'),(74,'Computer Programming','The process of writing, testing, debugging/troubleshooting, and maintaining the source code of computer programs.','http://en.wikipedia.org/wiki/Computer_Programming'),(75,'File Sharing','The providing and receiving of digital files over a network, usually following the peer-to-peer (P2P) model, where the files are stored on and served by personal computers of the users.','http://en.wikipedia.org/wiki/File_Sharing'),(76,'2600','The Hacker Quarterly magazine.','http://en.wikipedia.org/wiki/2600:_The_Hacker_Quarterly'),(77,'Bit Bucket','Jargon for where lost computerized data has gone - used here as a miscellaneous category.','http://en.wikipedia.org/wiki/Bit_bucket'),(78,'SSH','Secure Shell is a network protocol that allows data to be exchanged using a secure channel between two networked devices.','http://en.wikipedia.org/wiki/Secure_Shell'),(79,'Obfuscation','Deliberately obfuscate code to conceal its purpose, to deter reverse engineering, or as a puzzle or recreational challenge for readers.','http://en.wikipedia.org/wiki/Obfuscation'),(80,'Internet','A global system of interconnected computer networks that interchange data by packet switching using the standardized Internet Protocol Suite (TCP/IP).','http://en.wikipedia.org/wiki/Internet'),(81,'Help Desk','An information and assistance resource that troubleshoots problems with computers or similar products.','http://en.wikipedia.org/wiki/Help_Desk'),(82,'iPod','A brand of portable media players designed and marketed by Apple Inc.','http://en.wikipedia.org/wiki/IPod'),(83,'Access Control','The ability to permit or deny the use of a particular resource by a particular entity.','http://en.wikipedia.org/wiki/Access_Control'),(84,'Application Software','Any tool that functions and is operated by means of a computer, with the purpose of supporting or improving the software user\'s work.','http://en.wikipedia.org/wiki/Application_software'),(85,'TLS','Tansport Layer Security Protocol and its predecessor, Secure Sockets Layer (SSL), are cryptographic protocols that provide security and data integrity for communications over TCP/IP networks such as the Internet.','http://en.wikipedia.org/wiki/Transport_Layer_Security'),(86,'SSL','Secure Sockets Layer - see TLS - Transport Layer Security.','http://en.wikipedia.org/wiki/Transport_Layer_Security'),(87,'Man-in-the-middle','A form of active eavesdropping in which the attacker makes independent connections with the victims and relays messages between them, making them believe that they are talking directly to each other over a private connection when in fact the entire conversation is controlled by the attacker.','http://en.wikipedia.org/wiki/Man-in-the-middle'),(88,'Law','A system of rules, enforced through a set of institutions, used as an instrument to underpin civil obedience, politics, economics and society.','http://en.wikipedia.org/wiki/Law'),(89,'RF','Radio frequency - a frequency or rate of oscillation within the range of about 3 Hz to 300 GHz.','http://en.wikipedia.org/wiki/Radio_frequency'),(90,'ATM','Automated teller machine is a computerized telecommunications device that provides the customers of a financial institution with access to financial transactions in a public space without the need for a human clerk or bank teller.','http://en.wikipedia.org/wiki/Automated_teller_machine'),(91,'WPA','Wi-Fi Protected Access is a certification program administered by the Wi-Fi Alliance to indicate compliance with the security protocol created by the Wi-Fi Alliance to secure wireless computer networks.','http://en.wikipedia.org/wiki/Wi-Fi_Protected_Access'),(92,'Communication','The process to impart information from a sender to a receiver with the use of a medium.','http://en.wikipedia.org/wiki/Communication'),(93,'Technology','Usage and knowledge of tools and crafts, and how it affects an animal species\' ability to control and adapt to its environment.','http://en.wikipedia.org/wiki/Technology'),(94,'Hacktivism','The use of computers and computer networks as a means of protest to promote political ends or the nonviolent use of illegal or legally ambiguous digital tools in pursuit of political ends.','http://en.wikipedia.org/wiki/Hacktivism'),(95,'Identity Theft','A term used to refer to fraud that involves someone pretending to be someone else in order to steal money or get other benefits.','http://en.wikipedia.org/wiki/Identity_Theft'),(96,'Politics','The process by which groups of people make decisions.','http://en.wikipedia.org/wiki/Politics'),(97,'Cross-site Scripting','(XSS) is a type of computer security vulnerability typically found in web applications which allow code injection by malicious web users into the web pages viewed by other users.','http://en.wikipedia.org/wiki/Cross-site_Scripting'),(99,'Hacker','One who discovers and implements a hack.','http://en.wikipedia.org/wiki/Hacker_(programmer_subculture)'),(100,'Caller ID','A telephone 