ic physical or behavioral traits.','http://en.wikipedia.org/wiki/Biometrics'),(120,'Keystroke logging','Often called keylogging, is the practice of noting (or logging) the keys struck on a keyboard, typically in a covert manner so that the person using the keyboard is unaware that their actions are being monitored.','http://en.wikipedia.org/wiki/Keystroke_logging'),(121,'DHCP','Dynamic Host Configuration Protocol is a network application protocol used by devices (DHCP clients) to obtain configuration information for operation in an Internet Protocol network.','http://en.wikipedia.org/wiki/Dhcp'),(122,'Telemarketing','A method of direct marketing in which a salesperson solicits to prospective customers to buy products or services over the phone.','http://en.wikipedia.org/wiki/Telemarketing'),(123,'Book Review','A form of literary criticism in which a book is analyzed based on content, style, and merit.','http://en.wikipedia.org/wiki/Book_Review'),(124,'AppleTalk','A proprietary suite of protocols developed by Apple Inc for networking computers.','http://en.wikipedia.org/wiki/AppleTalk'),(125,'Pirate radio','Refers to illegal or unregulated radio transmissions.','http://en.wikipedia.org/wiki/Pirate_radio'),(126,'Reconnaissance','(also scouting) is a military and medical term denoting exploration conducted to gain information.','http://en.wikipedia.org/wiki/Reconnaissance'),(127,'ARP','Address Resolution Protocol (ARP) is the method for finding a host\'s link layer (hardware) address when only its Internet Layer (IP) or some other Network Layer address is known.','http://en.wikipedia.org/wiki/Address_Resolution_Protocol'),(128,'Cybercrime','Generally refers to criminal activity where a computer or network is the source, tool, target, or place of a crime.','http://en.wikipedia.org/wiki/Cybercrime'),(129,'PKI','Public Key Infrastructure is a set of hardware, software, people, policies, and procedures needed to create, manage, store, distribute, and revoke digital certifi