 is required during each phase of the testing for the purposes of initiating and terminating calls during the testing.  These stations will be assigned Directory Numbers (DNs) and be required to emulate a customers service for the purposes of this testing.  These tests were developed to establish the initial connectivity, indicate the beginning of the testing.\r\r4.1.1 - Preliminary Network Interconnection \r\r\r4.1.1.1	Ability of switch to make Non-ported to non-ported calls between switches\r\r\rTest Description:\r\rThis test will consist of a basic call through from each testing switch to every other testing switch using the testing switches and currently used interconnection.\r\r\rTest Procedure:\r\rA technical representative of each Service Provider company will select a working line that is being furnished dial tone from the represented switch.\rThe representative will furnish the other Service Providers the telephone number to be used.\rThe Service Provider representative will then proceed to call all other Service Provider numbers.\rRepresentatives of the other Service Provider companies will respond by answering the call, identifying themselves and company affiliation.\rT'),(1585,2007,'http://www.transnexus.com/News%20and%20Events/2009/Number_Portability_Astricon-2009.ppt','PowerPoint presentation describes LNP considerations for VoIP ca',NULL,'Ok','2011-04-10 10:51:44','N','Y','2011-04-11 13:22:47','O','http://www.transnexus.com/News%20and%20Events/2009/Number_Portability_Astricon-2009.ppt',NULL,''),(1586,2011,'https://privacybox.de/cgi-bin/tram_msg.pl?sus=maxvendor','Author\'s web site.',NULL,'Ok','2011-04-10 11:01:54','Y','Y','2011-04-11 13:22:58','O','https://privacybox.de/maxvendor.msg',NULL,'lines=27<br<pre>HTTP/1.1 200 OK<br>Date: Sun, 10 Apr 2011 15:01:53 GMT<br>Server: Apache<br>X-frame-options: DENY<br>Vary: Accept-Encoding<br>Transfer-Encoding: chunked<br>Content-Type: text/html; charset=UTF-8<br><br>&lt;!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4