r>   Users\\\' Glossary&lt;/i&gt;, usefully amplifies this as: A person who<br>   delights in having an intimate understanding of the internal workings of a<br></pre>Return Value: 0<br>'),(1801,2122,'http://catb.org/jargon/html/meaning-of-hack.html','The Jargon File \"Meaning of Hack\".',NULL,'Ok','2012-04-08 09:15:57','N','Y','2012-04-09 16:27:16','O','http://catb.org/jargon/html/meaning-of-hack.html',NULL,'lines=199<br><pre>HTTP/1.1 200 OK<br>Date: Sun, 08 Apr 2012 13:16:03 GMT<br>Server: Apache<br>Last-Modified: Mon, 29 Dec 2003 18:34:39 GMT<br>ETag: \\\"1150b62-4244-3cfa2c2252dc0\\\"<br>Accept-Ranges: bytes<br>Content-Length: 16964<br>Content-Type: text/html; charset=utf-8<br><br>&lt;?xml version=\\\"1.0\\\" encoding=\\\"UTF-8\\\" standalone=\\\"no\\\"?&gt;<br>&lt;html xmlns=\\\"http://www.w3.org/1999/xhtml\\\"&gt;&lt;head&gt;&lt;title&gt;The Meaning of Hack&lt;/title&gt;&lt;link rel=\\\"stylesheet\\\" href=\\\"jargon.css\\\" type=\\\"text/css\\\"/&gt;&lt;meta name=\\\"generator\\\" content=\\\"DocBook XSL Stylesheets V1.61.0\\\"/&gt;&lt;link rel=\\\"home\\\" href=\\\"index.html\\\" title=\\\"The Jargon File\\\"/&gt;&lt;link rel=\\\"up\\\" href=\\\"appendixa.html\\\" title=\\\"AppendixA.Hacker Folklore\\\"/&gt;&lt;link rel=\\\"previous\\\" href=\\\"appendixa.html\\\" title=\\\"AppendixA.Hacker Folklore\\\"/&gt;&lt;link rel=\\\"next\\\" href=\\\"tv-typewriters.html\\\" title=\\\"TV Typewriters: A Tale of Hackish Ingenuity\\\"/&gt;&lt;/head&gt;&lt;body&gt;&lt;div class=\\\"navheader\\\"&gt;&lt;table width=\\\"100%\\\" summary=\\\"Navigation header\\\"&gt;&lt;tr&gt;&lt;th colspan=\\\"3\\\" align=\\\"center\\\"&gt;The Meaning of Hack&lt;/th&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td width=\\\"20%\\\" align=\\\"left\\\"&gt;&lt;a accesskey=\\\"p\\\" href=\\\"appendixa.html\\\"&gt;Prev&lt;/a&gt;&lt;/td&gt;&lt;th width=\\\"60%\\\" align=\\\"center\\\"&gt;AppendixA.Hacker Folklore&lt;/th&gt;&lt;td width=\\\"20%\\\" align=\\\"right\\\"&gt;&lt;a accesskey=\\\"n\\\" href=\\\"tv-typewri